import "./App.css";
import dataJSON from "./data.json";
import { useState, useEffect } from "react";

function App() {
  const [elements, setElements] = useState(null);

  useEffect(() => {
    setElements(dataJSON);
  }, []);
  const { view } = elements ?? {};
  console.log(JSON.stringify(view));

  return <div className="App">hi {view}</div>;
}

export default App;
